var GetPersonInfoEntity =function(_subdomain,accountID,passportID,callback){
    thenJs(function(cont){
        var jData = {
            "accountID":accountID,
            "passportID":passportID
        };
        var param={
            command:"CPEC.Platform.Service.Platform.PersonInfoService.GetEntity",
            data:jData,
            subdomain:_subdomain
        };
        asyncData.getPlatformServiceByThen(cont,param);
    }).then(function(cont,data){
        callback(data);
    })
}

